"methods","techniques","software","research","analyst","interpretation"],"name":"Data Science","description":"Data science Specializations and courses teach the fundamentals of interpreting data, performing analyses, and understanding and communicating actionable insights. Topics of study for beginning and advanced learners include qualitative and quantitative data analysis, tools and methods for data manipulation, and machine learning algorithms.","id":"data-science"},{"subdomainIds":["cloud-computing","security","data-management","networking","support-and-operations"],"keywords":["networking","cloud computing","security","data management","operations"],"name":"Information Technology","description":"Information Technology (IT) courses and specializations teach cloud computing, cyber security, data management, networking, and more. Learn to use computers to meet day-to-day business needs and launch or advance your career in the IT industry.","id":"information-technology"},{"subdomainIds":["animal-health","basic-science","health-informatics","healthcare-management","nutrition","patient-care","public-health","research","psychology"],"keywords":["science","cellular","molecular","agriculture","companies","branches","impact factor","bio","biotechnology","zoology","biology","neuroscience","horticulture","biochemistry","plant"],"name":"Health","description":"Health Specializations and courses explore topics related to science, your health, and the health and well being of others. Whether you're interested in science, a trained healthcare professional, or looking to transition into this rapidly growing industry, health courses will improve your ability to understand animal and plant life, use big data to solve key health challenges, manage teams, and conduct evidence-based research.","id":"life-sciences","slug":"health"},{"subdomainIds":["math-and-logic"],"keywords":["problems","logical","mathematical","philosophy","calculator","puzzles","logically","thinking","reasoning","fallacies","computational","symbols","solving","applications","everyday","models"],"name":"Math and Logic","description":"Specializations and courses in math and logic teach sound approaches to solving quantifiable and abstract problems. You'll tackle logic puzzles, develop computational skills, build your ability to represent real-world phenomena abstractly, and strengthen your reasoning capabilities.","id":"math-and-logic"},{"subdomainIds":["personal-development"],"keywords":["plan","goals","skills","coach","tips","self","improvement","personality","professional","goal setting","growth","activities","best","action","leadership"],"name":"Personal Development","description":"Personal development Specializations and courses teach strategies and frameworks for personal growth, goal setting, and self improvement. You'll learn to manage personal finances, deliver effective speeches, make ethical decisions, and think more creatively.","id":"personal-development"},{"subdomainIds":["electrical-engineering","mechanical-engineering","chemistry","environmental-science-and-sustainability","physics-and-astronomy","research-methods"],"keywords":["computer","electrical","civil","mechanical","sciences","physics","mathematics","engineer","chemistry","material","chemical","technology","experiments","astronomy","earth","geoscience"],"name":"Physical Science and Engineering","description":"Physical science and engineering Specializations and courses teach the properties of the world around us, from core concepts in physics and chemistry to applied topics in engineering. Courses in this field will prepare you for a career in electrical, civil, or mechanical engineering, or in research or applied science.","id":"physical-science-and-engineering"},{"subdomainIds":["economics","education","governance-and-society","law"],"keywords":["medicine","economics","humanities","social","studies","behavioral","science","applied","research","methods","disciplines","statistical","history"],"name":"Social Sciences","description":"Social sciences Specializations and courses explore how populations form laws, make decisions, behave in groups, and structure their communities. From education to economics to law, courses in the social sciences will improve your understanding of the dynamics between individuals and groups, and your ability to analyze behaviors and trends.","id":"social-sciences"},{"subdomainIds":["learning-english","other-languages"],"keywords":["lessons","learn","language learning","learn chinese","learn english","english language courses","learn to speak","foreign language","spanish","other languages","grammar","speaking","conversation","writing"],"name":"Language Learning","description":"In language courses and Specializations, you’ll learn to speak, write, and listen effectively in major global languages, including English, Chinese, Spanish, and more. Whether you’re learning a foreign language or improving your communication skills in your native language, coursework in this area will help you understand grammar and syntax conventions, and will prepare you to communicate with confidence in both business interactions and casual conversation.","id":"language-learning"}],"courseId":"ORAIlTLtEeizIBKbQHnlqg","courseSlug":"python-for-data-visualization","courseCertificates":["VerifiedCert","Specialization"],"courseTypeMetadata":{"typeName":"standardCourse","definition":{"typeNameIndex":"standardCourse"}},"rawCourseMaterials":{"courseData":{"isReal":true,"certificatePurchaseEnabledAt":1522285507995,"estimatedWorkload":"3 weeks of study, 4-5 hours\u002Fweek","description":"One of the most important skills of successful data scientists and data analysts is the ability to tell a compelling story by visualizing data and findings in an approachable and stimulating way. In this course you will learn many ways to effectively visualize both small and large-scale data. You will be able to take data that at first glance has little meaning and present that data in a form that conveys insights. \n\nThis course will teach you to work with many Data Visualization tools and techniques. You will learn to create various types of basic and advanced graphs and charts like: Waffle Charts, Area Plots, Histograms, Bar Charts, Pie Charts, Scatter Plots, Word Clouds, Choropleth Maps, and many more! You will also create interactive dashboards that allow even those without any Data Science experience to better understand data, and make more effective and informed decisions.   \n\nYou will learn hands-on by completing numerous labs and a final project to practice and apply the many aspects and techniques of Data Visualization using Jupyter Notebooks and a Cloud-based IDE. You will use several data visualization libraries in Python, including Matplotlib, Seaborn, Folium, Plotly & Dash.","isRestrictedMembership":false,"domainTypes":[{"subdomainId":"data-analysis","domainId":"data-science"}],"verificationEnabledAt":1522285507995,"isVerificationEnabled":true,"sessionsEnabledAt":1522285507995,"previewUserIds":[],"id":"ORAIlTLtEeizIBKbQHnlqg","slug":"python-for-data-visualization","instructorIds":["30396287","125758299"],"subtitleLanguageCodes":["ar","fr","bn","uk","zh-CN","el","it","pt-BR","nl","ko","de","ps","ur","ru","th","id","sv","tr","az","es","fa-AF","hi","ja","kk","hu","pl"],"enrollableSiteUserRoles":[],"promoPhoto":"https:\u002F\u002Fcoursera-course-photos.s3.amazonaws.com\u002F62\u002F5322b0381e11e8b10fefac82942bd7\u002FData-Visualization-with-Python.png","primaryLanguageCodes":["en"],"premiumExperienceVariant":"PremiumGrading","partnerIds":["348"],"categoryIds":[],"isSubtitleTranslationEnabled":true,"name":"Data Visualization with Python","courseStatus":"launched","launchedAt":1525712251263,"overridePartnerLogos":{},"instructors":[{"lastName":"Swaminathan","prefixName":"","photo":"https:\u002F\u002Fd3njjcbhbojbot.cloudfront.net\u002Fapi\u002Futilities\u002Fv1\u002Fimageproxy\u002Fhttps:\u002F\u002Fcoursera-instructor-photos.s3.amazonaws. t\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp data-text-variant=\"body1\"\u003EUpon completing this Professional Certificate, you will be armed with the skills and knowledge to start an entry level role in data analytics. You can also apply your newly-acquired analytical skills to enrich your current career in a variety of industries including banking, accounting, and IT and functions such as marketing, finance, and research.\u003C\u002Fp\u003E\u003Cp data-text-variant=\"body1\"\u003EData analytics skills are also valuable as an entry point to other data-related professions such as data science, data engineering, and business analytics.\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}}},{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003ECan I get college credit for taking the IBM Data Analyst Professional Certificate?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003ECan I get college credit for taking the IBM Data Analyst Professional Certificate?\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext variant=\"body1\"\u003EYes. The IBM Data Analyst Professional Certificate secured a credit recommendation from the American Council on Education’s (\u003Ca href=\"https:\u002F\u002Fwww.coursera.support\u002Fs\u002Farticle\u002Flearner-000001647-ACE-credit-recommendation-FAQs?language=en_US\" title=\"\"\u003EACE)\u003C\u002Fa\u003E Credit Recommendation, as well as the European Credit Transfer and Accumulation System (\u003Ca href=\"https:\u002F\u002Fwww.coursera.support\u002Fs\u002Farticle\u002Flearner-000002117-ECTS-credit-recommendation-FAQs?language=en_US\" title=\"\"\u003EECTS\u003C\u002Fa\u003E) from the Foundation for International Business Administration Accreditation (FIBAA) – industry standards for translating workplace learning into college credit. This aims to help open up additional pathways to learners who are interested in higher education and prepare them for entry-level jobs.&#xa0;\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":false,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp data-text-variant=\"body1\"\u003EYes. The IBM Data Analyst Professional Certificate secured a credit recommendation from the American Council on Education’s (\u003Ca href=\"https:\u002F\u002Fwww.coursera.support\u002Fs\u002Farticle\u002Flearner-000001647-ACE-credit-recommendation-FAQs?language=en_US\" title=\"\" target=\"_blank\" rel=\"noopener nofollow\" aria-label=\"\"\u003EACE)\u003C\u002Fa\u003E Credit Recommendation, as well as the European Credit Transfer and Accumulation System (\u003Ca href=\"https:\u002F\u002Fwww.coursera.support\u002Fs\u002Farticle\u002Flearner-000002117-ECTS-credit-recommendation-FAQs?language=en_US\" title=\"\" target=\"_blank\" rel=\"noopener nofollow\" aria-label=\"\"\u003EECTS\u003C\u002Fa\u003E) from the Foundation for International Business Administration Accreditation (FIBAA) – industry standards for translating workplace learning into college credit. This aims to help open up additional pathways to learners who are interested in higher education and prepare them for entry-level jobs.&nbsp;\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}}},{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EHow do you share your proof of completion with the educational institutions for transferring credit?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EHow do you share your proof of completion with the educational institutions for transferring credit?\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext variant=\"body1\"\u003ETo share proof of completion with schools, certificate graduates will receive an email prompting them to claim their Credly badge, which contains the ACE®️ credit or ECTS recommendation.&#xa0; Once claimed, you will receive a competency-based transcript that signifies the credit recommendation, which can be shared directly with a school from the Credly platform. Please note that the decision to accept specific credit recommendations is up to each institution and is not guaranteed.&#xa0;&#xa0;\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp data-text-variant=\"body1\"\u003ETo share proof of completion with schools, certificate graduates will receive an email prompting them to claim their Credly badge, which contains the ACE®️ credit or ECTS recommendation.&nbsp; Once claimed, you will receive a competency-based transcript that signifies the credit recommendation, which can be shared directly with a school from the Credly platform. Please note that the decision to accept specific credit recommendations is up to each institution and is not guaranteed.&nbsp;&nbsp;\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}}},{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EWhere can I find more information on credit recommendations?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EWhere can I find more information on credit recommendations?\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EFor ACE recommendations, please see \u003Ca href=\"https:\u002F\u002Fwww.coursera.support\u002Fs\u002Farticle\u002Flearner-000001647-ACE-credit-recommendation-FAQs?language=en_US\" title=\"\"\u003ECoursera’s ACE Recommendations FAQ\u003C\u002Fa\u003E. For ECTS recommendations, please see \u003Ca href=\"https:\u002F\u002Fwww.coursera.support\u002Fs\u002Farticle\u002Flearner-000002117-ECTS-credit-recommendation-FAQs?language=en_US\" title=\"\"\u003ECoursera’s ECTS Recommendations FAQ\u003C\u002Fa\u003E.\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":false,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EFor ACE recommendations, please see \u003Ca href=\"https:\u002F\u002Fwww.coursera.support\u002Fs\u002Farticle\u002Flearner-000001647-ACE-credit-recommendation-FAQs?language=en_US\" title=\"\" target=\"_blank\" rel=\"noopener nofollow\" aria-label=\"\"\u003ECoursera’s ACE Recommendations FAQ\u003C\u002Fa\u003E. For ECTS recommendations, please see \u003Ca href=\"https:\u002F\u002Fwww.coursera.support\u002Fs\u002Farticle\u002Flearner-000002117-ECTS-credit-recommendation-FAQs?language=en_US\" title=\"\" target= d comfort with numbers. \u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},"sponsors":[],"headline":"Prepare for a career as a data analyst"},"courseIds":["ZWYBq9zVEeqMbw6VbjEnNw","3bkTOtzVEequVRKuqBsDQw","NRRbf9zWEeqPZRKxGtAxBQ","ejOz7RDUEei99hK0xs-tsg","6YUb5lHkEeuV3xJQIImqCQ","GDQMSxDWEeitFhJL4G-A_g","fYuElDEgEeiCvhLLCIZW_A","ORAIlTLtEeizIBKbQHnlqg","iXdYzvOYEeqt_RIaY9taQQ"],"description":"Prepare for a career in the high-growth field of data analytics. In this program, you’ll learn in-demand skills like Python, Excel, and SQL to get job-ready in as little as 4 months.\n\nData analysis is the process of collecting, storing, modeling, and analyzing data that can inform executive decision-making, and the demand for skilled data analysts has never been greater.\n\nThis program will teach you the foundational data skills employers are seeking for entry-level data analytics roles. It will not only help you start your career in data analytics, but also provides a strong foundation for future career development in other paths such as data science, artificial intelligence, deep learning, or data engineering.\n\nYou’ll learn the latest skills and tools used by professional data analysts including Excel spreadsheets, Python, Pandas, Numpy, Jupyter Notebooks, Cognos Analytics, and more. You’ll work with a variety of data sources and project scenarios to gain practical experience with data manipulation and applying analytical skills.\n\nWhen you complete the full program, you’ll have a portfolio of projects and a Professional Certificate from IBM to showcase your expertise. You’ll also earn an IBM Digital badge and will gain access to career resources to help you in your job search, including mock interviews and resume support.\n\nThis program is ACE® and FIBAA recommended—when you complete, you can earn up to 12 college credits and 6 ECTS credits.","interchangeableCourseIds":[],"premiumExperienceVariant":"PremiumGrading","partnerIds":["348"],"name":"IBM Data Analyst","tagline":"P those who are interested in pursuing a career in data analysis or data science, as well as anyone looking to use Excel for data analysis in their own domain. No prior experience with spreadsheets or coding is required - all you need is a device with a modern web browser and the ability to create a Microsoft account to access Excel online at no cost. If you have a desktop version of Excel, you can also easily follow along with the course. \n \nThroughout this course, you'll gain valuable experience working with data sets and spreadsheets. We'll start by introducing you to spreadsheets like Microsoft Excel and Google Sheets, and show you how to load data from multiple formats. From there, you'll learn how to perform basic data wrangling and cleansing tasks using functions, and expand your knowledge of data analysis through the use of filtering, sorting, and pivot tables. \n \nThere is a strong focus on practice and applied learning in this course. With each lab, you'll have the opportunity to manipulate data and gain hands-on experience using Excel. You'll learn how to clean and format your data efficiently, and convert it into a pivot table to make it more organized and readable. The final project will allow you to showcase your newly acquired data analysis skills by working with real data sets and spreadsheets. \n \nBy the end of this course, you'll have a solid foundation in using Excel for data analysis. You'll have worked with multiple data sets and spreadsheets, and will have the skills and knowledge needed to effectively clean and analyze data without having to learn any code. So let's get started!","id":"3bkTOtzVEequVRKuqBsDQw","slug":"excel-basics-data-analysis-ibm","name":"Excel Basics for Data Analysis","startDate":1600127929509,"courseProgress":"105036570~3bkTOtzVEequVRKuqBsDQw","v2Details":{"plannedLaunchDate":"September 15th, 2020","id":"3bkTOtzVEequVRKuqBsDQw","onDemandSessions":["rYx9t5eZEe610wrDycT3lQ","H4OEwMXHEe2e6gq59xMm6w","d15CIAXdEeyOTQoBPJCdPw"
